### 根据参数读取并返回数据

这个 api 可以把读取的 Markdown 内容转化成了 HTML，这样可以减轻最后生成的网站文件大小，原因可见 [如何减轻Nuxt打包生成的代码量](/blog/lighten-nuxt-website)。

