做完之后我又研究了下，觉得这个单页面的 `CMS` 既符合 `基于 API 的 Headless CMS` 的特征，又符合 `Flat File CMS` 的特征，也就是 `不操作数据库而是操作文本文件的 CMS`，感觉好像很高级嘛~

而且预览区和目录区都会随着输入和保存、删除等动作自动更新，写作时无比丝滑顺畅，拿来写文档、写小说啥的好像都不错。

啊，我不知道怎么夸自己才好了。

不说这些肉麻的，总之这次写了个有用的东西，希望以后也能写出更多有用的东西。

